<html>
<title>Browses</title>
<head>
	<style>
		* {
			display: block;
			box-sizing: border-box;
			margin: 0;
			border: 0;
			padding: 0;
		}
		head, script {
			display: none;
		}
		html {
			font-family: sans-serif;
			font-size: calc(10px + 1vw);
		}
		browses-feed {
			width: 100%;
			min-height: 100vh;
			font-size: 10px;
		}
		browse- {
			max-width: 80%;
			margin: 0 auto;
			margin-bottom: 2rem;
			color: #b6b6b6;
		}
		browse- article {
			padding: 2rem;
		}
		browse- img {
			display: block;
			max-width: 100%;
			box-shadow: 0 1px 5px 1px rgba(0,0,0,0.2);
		}
		browse- info- {
			display: block;
			margin: 0;
		}
		browse- info- a {
			color: rgba(0,0,0,0.5);
			display: inline;
		}

		browse- title- {
			display: block;
			width: 100%;
			overflow: hidden;
			font-size: 1rem;
			white-space: nowrap;
			text-overflow: ellipsis;
			margin-bottom: 1rem;
			color: rgba(0,0,0,0.62);
		}

		browse- browser-count {
			display: block;
			margin-top: .25rem;
		}

		user-name {
			display: flex;
			flex-direction: column;
			height: 80vh;
		}

		user-name h1 {
			margin: auto;
			margin-bottom: 0;
			font-size: calc(1rem + 4vw);
		}

		user-name h3 {
			margin: auto;
			margin-top: 2rem;
			font-size: calc(1rem + .5vw);
			letter-spacing: .3rem;
			color: rgba(0,0,0,0.5);
		}

		header {
			position: fixed;
			right: 0;
			background: #fff;
			padding: 18px 24px 6px 0;
		}

		svg {
			width: 150px;
		}

	</style>
</head>
